import React from "react";
import "./App.css";
import { Button } from "antd";
const edc = require("email-domain-check");

function App() {
  edc("tom@hotmail.com").then(function (result) {
    console.log(result); //true
  });

  return (
    <div className="App">
      <Button type="primary">PRESS ME</Button>
    </div>
  );
}

export default App;
